import React from 'react';
import "isomorphic-fetch";

async function getStaticProps() {
    const res = await fetch("https://api.github.com/orgs/rocketseat/repos")
    const posts = await res.json()
  
    return {
      props: {
        posts,
      },
    }
  }

  export default getStaticProps;
